import React, { Children } from 'react';

import './custom-button.style.scss';

const CustomButton = ({Children, ...otherProps}) => {
    return (
        <div>
            <button 
            className='custom-button'
            {...otherProps}
            >
            {Children}
            </button>
        </div>
    )
}

export default CustomButton;
